import styles from './style.scss';
import { NavLink } from 'react-router-dom';

class Navbar extends React.Component {
    constructor(){
        super();
        this.state = {

        }

    }
    mouseHandler=(e)=>{
        console.log(e.type);
        if (e.type == "mouseover"){
            console.log(e.target)
            e.target.styles.color = "blue"
        }


    }

  render() {
      // console.log('Login state', this.state);
    return (
        <React.Fragment>
        <nav className="navbar navbar-default">
  <div className="container-fluid">
    <div className="navbar-header">
      <a className="navbar-brand" href="#">Lunch Buddy Finder</a>
    </div>
    <ul className="nav navbar-nav">
      <li><NavLink onMouseOver={this.mouseHandler} to="/home" style={{"background-color":"red"}}>Home</NavLink></li>
      <li><NavLink to="/search">Search Lunch Buddies</NavLink></li>
      <li><NavLink to="/login">Logout</NavLink></li>
    </ul>
  </div>
</nav>
</React.Fragment>
    );
  }
}


export default Navbar;
